// Get the SQL query from the previous node
const sqlQuery = $json["text"];

// Basic validation to prevent dangerous queries
const disallowedPatterns = [
  /;\s*--/, // End of statement with comment
  /DROP\s+TABLE/i,
  /DELETE\s+FROM/i,
  /UPDATE\s+/i,
  /INSERT\s+INTO/i,
  /ALTER\s+TABLE/i,
];

for (const pattern of disallowedPatterns) {
  if (pattern.test(sqlQuery)) {
    throw new Error("Generated SQL query contains disallowed operations.");
  }
}

// If safe, pass the SQL query along
return { sqlQuery };

// Access the items from the previous node (MySQL node)
const queryResults = items.map(item => item.json);

// Check if there are any results
if (queryResults.length === 0) {
  return [{ json: { textOutput: "No results found for your query." } }];
}

// Extract column names (headers)
const headers = Object.keys(queryResults[0]);

// Initialize an array to hold formatted lines
let lines = [];

// Create a header row (optional)
lines.push(headers.join(' | '));
lines.push(headers.map(() => '---').join(' | ')); // For Markdown table formatting

// Iterate over each result item
queryResults.forEach(item => {
  const row = headers.map(header => item[header]);
  lines.push(row.join(' | '));
});

// Join all lines into a single string with line breaks
const textOutput = lines.join('\n');

// Return the formatted text as a new field
return [{ json: { textOutput } }];

// Iterate over each incoming item
return items.map(item => {
  // Determine if there's an error
  const hasError = !!item.json.error;

  // Select 'error' if present; otherwise, use 'output'
  const rawMessage = hasError ? item.json.error : item.json.output;

  // Ensure the message is a string
  let safeMessage = String(rawMessage);

  // Escape special characters to maintain valid JSON
  safeMessage = safeMessage
    .replace(/\\/g, '\\\\')   // Escape backslashes
    .replace(/"/g, '\\"')     // Escape double quotes
    .replace(/\n/g, '\\n')    // Escape newlines
    .replace(/\r/g, '\\r');   // Escape carriage returns

  // Structure the response object
  const response = {
    response: safeMessage
  };

  // Return the new item with the 'response' field
  return {
    json: response
  };
});

