  `bigquery-public-data.google_analytics_sample.ga_sessions_*`;

- **Natural Language Query:** "Count How many rows in the entire dataset"
  **SQL Query:**
  SELECT COUNT(*) AS total_rows
  FROM `bigquery-public-data.google_analytics_sample.ga_sessions_*`
  WHERE _TABLE_SUFFIX BETWEEN '20160801' AND '20170801';

- **Natural Language Query:** "What are the top 10 most frequent event categories?"
  **SQL Query:**
  SELECT
  hits.eventInfo.eventCategory AS search_query,
  COUNT(*) AS occurrences
  FROM `bigquery-public-data.google_analytics_sample.ga_sessions_*`,
    UNNEST(hits) AS hits
  WHERE _TABLE_SUFFIX BETWEEN '20160801' AND '20170801'
  AND hits.type = 'EVENT'
  AND hits.eventInfo.eventCategory IS NOT NULL
  GROUP BY search_query
  ORDER BY occurrences DESC
  LIMIT 10;


